import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import Dashboard from './pages/Dashboard';
import Agenda from './pages/Agenda';
import InventarioBovino from './pages/InventarioBovino';
import Gramineas from './pages/Gramineas';
import InventarioFisico from './pages/InventarioFisico';

function App() {
  return (
    <Router>
      <nav style={{ padding: 10, background: '#e0e0e0' }}>
        <Link to="/" style={{ margin: 10 }}>Dashboard</Link>
        <Link to="/agenda" style={{ margin: 10 }}>Agenda</Link>
        <Link to="/bovinos" style={{ margin: 10 }}>Inventario Bovino</Link>
        <Link to="/gramineas" style={{ margin: 10 }}>Gramíneas</Link>
        <Link to="/fisico" style={{ margin: 10 }}>Inventario Físico</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/agenda" element={<Agenda />} />
        <Route path="/bovinos" element={<InventarioBovino />} />
        <Route path="/gramineas" element={<Gramineas />} />
        <Route path="/fisico" element={<InventarioFisico />} />
      </Routes>
    </Router>
  );
}

export default App;
